let initialState = {
    MainNumberURL:''
}

export const showReducer = (state=initialState, action) =>{

    switch (action.type) {
        case 'newURL':
            return{
                ...state,
                MainNumberURL: action.url
            }
        default: {
            return state;
        }
    }
}
export const changeUrl = (url) => {
    return{
        type: 'newURL',
        url
    }
}
